import React from 'react';
import styled from 'styled-components';
import { Dialog } from '../FoodDialog/FoodDialog';

const CDialog = styled.div`
width: 500px;
height: 1000px;
background-color: white;
position: fixed;
top: 80px;
z-index: 5;
max-height: calc(100% - 100px);
left: calc(50% - 250px);
display: flex;
flex-direction: column;
`;

const CDialogShadow = styled.div`
    position: fixed;
    height: 100%;
    width: 100%;
    top: 0px;
    background-color: black;
    opacity: 0.7;
    z-index: 4;
`

const DashBanner = styled.div`
min-height: 200px;
margin-bottom: 20px;
background-image: url("img/shark.jpeg");
background-position: center;
background-size: cover;
`;

export function CatDialog(){
    return <>
    <CDialogShadow/>
    <CDialog>
        <DashBanner/>
    </CDialog>
    </>
}
